import React from 'react'

function Result(book, coverImageData) {
  return (
    <div><img src={`https://covers.openlibrary.org/b/id/${coverImageData}-L.jpg`}/><h4>{book.title}</h4><h5>{book.author_name[0]}</h5></div>
  )
}

export default Result
